import './App.css';
import Counter from './Components/Counter.js'
import Table from './Components/Table/Table.js'
import Navigation from "./Components/BaseUi/TopNav/Navigation";
import React from "react";
import SubHeader from "./Components/BaseUi/SubNav/SubNav";

function App() {
  return (
      <div className="bg-gray-900 h-screen">

            <Navigation/>

            <SubHeader title={["Dashboard","Something Else"]}/>

          <div>
          <div className="flex flex-row">

                              <div className="flex flex-col bg-gray-200 rounded-md h-full">
                                  <div className="text-gray-700 text-center bg-gray-400 px-4 py-2 m-1 rounded-md">Item</div>
                                  <div className="text-gray-700 text-center bg-gray-400 px-4 py-2 m-1 rounded-md">Item</div>
                                  <div className="text-gray-700 text-center bg-gray-400 px-4 py-2 m-1 rounded-md">Item</div>
                              </div>


                          <div className="text-gray-700 text-center bg-gray-400 px-4 py-2 m-2 flex-grow rounded-md">
                              <Table/>
                              <Counter/>

                          </div>

                          <div className="flex flex-col bg-gray-200 rounded-md">
                              <div className="text-gray-700 text-center bg-gray-400 px-4 py-2 m-1 rounded-md">Item </div>
                              <div className="text-gray-700 text-center bg-gray-400 px-4 py-2 m-1 rounded-md">Item</div>
                              <div className="text-gray-700 text-center bg-gray-400 px-4 py-2 m-1 rounded-md">Item</div>
                          </div>

                          </div>
    </div>
      </div>



  );
}

export default App;
